import React, { Component } from 'react';
import './App.css';
import Logo from './images/logo.png';
import Staff from './images/staff.png';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
	  <img id="logo" src={Logo} alt="EZNote" />
          <p id="intro">Hear what your music sounds like!</p>
        </header>
	<div id="body">
	  <img id="staff" src={Staff} alt="Staff could not be displayed." />
	  <div>
	    <form id="playback">
	      <p>Speed (bpm):</p>
	      <input id="speedinput" type="text" name="speed" value="100" /><br/>
	      <input id="playbutton" type="submit" value="Play &#x25ba;"></input>
	    </form>
	  </div>
	</div>
      </div>
    );
  }
}

export default App;
